import "./Card.css";

export default function Card(props) {
  return (
    <div className="card">
      <img className="card_image" src={props.url} />
      <div className="container">
        <h2 className="card__title">
          <b>{props.name}</b>
        </h2>
        <p className="card__description">{props.discription}</p>
      </div>
    </div>
  );
}
